import React from 'react';
import './Experience.css'; // Optional: for custom styling

const Experience = () => {
  return (
    <div className="experience">
      <h1>Experience</h1>
      <div id="experienceElements">
        <h2>Software Engineering Intern at <a href="https://www.target.com/">Target</a></h2>
        <h3>June 2021 - August 2021</h3>
        <ul>
          <li>Developed a new feature for the Target.com website using React.js and Node.js.</li>
          <li>Collaborated with a team of 5 developers to implement the feature.</li>
          <li>Wrote unit tests for the new feature using Jest and Enzyme.</li>
        </ul>
      </div>
    </div>
  );
};

export default Experience;
